INSERT INTO `imovels` (`id`, `destaque`, `name`, `slug`, `codigo`, `status`, `tipo_id`, `cidade_id`, `bairro_id`, `area`, `quarto`, `garagem`, `banheiro`, `sala`, `preco`, `preco_adicionais`, `latitude`, `longitude`, `endereco`, `description`, `link_360`, `image`, `video`, `created_at`, `updated_at`, `banner`) VALUES
(39, 1, 'Propriedade Linha Casteliano', 'propriedade-linha-casteliano', '001', 1, 7, 4, 8, 0, 0, 0, 0, NULL, '0.00', NULL, NULL, NULL, 'Próximo a cidade de Jaborá, SC.', '<p>Propriedade para investir, de alto grau de qualidade, granjas de suíno, local incrível.</p><p><br></p><p><strong>Conheça um pouco mais sobre:</strong></p><ol><li>6 Hectares de terra</li><li>Chiqueiro de 12X75, com 351 BOX, todo suspensão, automático, com exaustor e nebulizador.</li><li>Chiqueiro de 12X50 gestação, automatizado, para 220 fêmeas.</li><li>Chiqueiro de 09X45, para 48 parideiras, todas suspensas</li><li>Chiqueiro de 08X30, de 100 metros, para 120 parideiras, sendo 80 parideiras com piso térmico.</li><li>Chiqueiro de 09X90, crechário, capacidade para 2.000 leitões, automatizado e todo suspenso, 2.5 anos de uso.</li><li>Compostagem de adubo 13.70X45</li><li>Escritório moderno e completo</li><li>Trator Agrale 4.200 especial para granja</li><li>Casa de alvenaria de 10X11, duas moradias, salão de festas.</li><li>Casa de alvenaria de 07X10 para caseiro.</li><li>Casa de Alvenaria de 07X08 para caseiro</li><li>Bomba jato para lavar chiqueiros</li><li>Balança eletrônica&nbsp;</li><li>2 Fontes de água natural</li><li>Água de poço artesiano</li><li>Açude</li><li>3.500 pés de eucaliptos 07 anos</li><li>Energia elétrica trifásica</li><li>Total de 620 matrizes</li><li>Granja de 04 anos de uso.</li></ol><p><br></p>', NULL, '223319201810085bbbdb2f9967a.jpg', NULL, '2018-10-09 01:33:19', '2018-11-02 15:54:11', '223319201810085bbbdb2fa13c0.jpg'),
(40, 1, 'Propriedade Rural - Linha Gasperin', 'propriedade-rural-linha-gasperin', '002', 1, 7, 1, 9, 0, 0, 0, 0, NULL, '0.00', NULL, NULL, NULL, 'Propriedade em Linha Gasperin', '<p>Propriedade para morar tranquilo ou investir, faturamento anual incrível. </p><p><br></p><p><strong>Detalhes:</strong></p><p>21.5 Hectares</p><p>01 Casa de Alvenaria de 18X12</p><p>01 Chiqueiro 100X12 crechário, capacidade 2.100 suínos, capacidade para 2.800 suínos, parceria JBS</p><p>04 Açudes&nbsp;</p><p>01 Estábulo canalizado 03 teteiras cada 20X10</p><p>12 Vacas de leite</p><p>01 Resfriador 680 litros</p><p>01 Ordenhadeira</p><p>4.000 pés de erva mate</p><p>Água poço artesiano comunitário</p><p>Água de fonte natural</p><p>Operadoras de celular TIM</p><p>Internet</p><p><br></p>', NULL, '152606201811165beee18e4f66e.jpeg', NULL, '2018-10-09 01:56:53', '2018-11-16 17:26:08', '152608201811165beee190b05e9.jpeg'),
(41, 0, 'Propriedade em São João', 'propriedade-em-sao-joao', '003', 1, 7, 6, 10, 0, 0, 0, 0, NULL, '0.00', NULL, NULL, NULL, 'São João', '<p>Propriedade linda para se morar, criar animais, ficar tranquilo! </p><p><br></p><p>09 Hectares</p><p>Casa de Madeira 43.8 metros de madeira tratada</p><p>Mangueira de 09 X 12 Coberta</p><p>Barracão de 15 X 12</p><p>Água de Poço Artesiano</p><p>Água de Fonte Natural</p><p>Uma Açude&nbsp;</p><p>1.300 Metros do Asfalto</p><p>100% Cercada 	</p><p>Piqueteada&nbsp;</p><p>Comunidade de São João – Alto Bela Vista</p><p><br></p>', NULL, '220932201810115bbfca1c41d0a.jpg', NULL, '2018-10-12 01:09:32', '2018-11-16 16:55:50', '220932201810115bbfca1c4cb11.jpg'),
(42, 0, 'Propriedade - Linha das Palmeiras', 'propriedade-linha-das-palmeiras', '004', 1, 7, 6, 10, 0, 0, 0, 0, NULL, '0.00', NULL, NULL, NULL, 'Linha das Palmeiras', '<p>Excelente propriedade, beleza, paz até investimento!</p><p><br></p><ol><li>18.70 Hectares</li><li>Casa de Madeira 12 X 10</li><li>Água de Poço Artesiano</li><li>Água de Fonte Natural</li><li>Uma Mangueira Descoberta</li><li>Um Chiqueiro desativado que pode ser utilizado como estábulo&nbsp;</li><li>100% Cercada</li><li>Piqueteada</li><li>2.800 Metros de Estrada de Chão</li><li>Localidade de Linha das Palmeiras – Alto Bela Vista</li></ol><p><br></p>', NULL, '125211201810125bc098fb55172.jpg', NULL, '2018-10-12 15:52:11', '2018-11-02 16:24:35', '125211201810125bc098fb5e441.jpg'),
(43, 0, 'Propriedade Sede Brum', 'propriedade-sede-brum', '005', 1, 7, 1, 9, 0, 0, 0, 0, NULL, '0.00', NULL, NULL, NULL, 'Sede Brum - Concórdia, SC', '<p>Venha conhecer, algumas informações aqui em baixo. Entenda um pouco do que é esta propriedade :) </p><p><br></p><ol><li>26 Hectares</li><li>Casa Mista de 08 X 10 com porão</li><li>01 Mangueira para Confinamento de 12 X 60</li><li>Água de Poço Artesiano</li><li>Água de Fonte Natural</li><li>Duas Açudes</li><li>12.5 KM de Estrada de Chão</li><li>100% Cercada</li><li>Comunidade de Sede Brum - Concórdia</li></ol><p><br></p>', NULL, '131943201810125bc09f6ff21dd.jpg', NULL, '2018-10-12 16:19:44', '2018-10-12 16:20:49', '131944201810125bc09f70009db.jpg'),
